CREATE TABLE user
(
    id        BIGINT AUTO_INCREMENT NOT NULL,
    name      VARCHAR(255)          NULL,
    email     VARCHAR(255)          NULL,
    status    VARCHAR(255)          NULL,
    address   VARCHAR(255)          NULL,
    phone     VARCHAR(255)          NULL,
    image_url VARCHAR(255)          NULL,
    CONSTRAINT pk_user PRIMARY KEY (id)
);





set SQL_SAFE_UPDATES = 0;


update user set
    image_url = concat('https://randomuser.me/api/portraits/men/', FLOOR(RAND()*1000), '.jpg');


update user set status = 'BANNED' where (id % 2 = 0);
update user set status = 'BANNED' where (id > 40 and id < 20);

update user set status = 'ACTIVE' where status != 'BANNED';








